import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Resources() {
    return (
        <>
            <div className='resources'>
                <h1>RESOURCES</h1>
                <h4>yo</h4>
                <ul style={{ padding: "100px", textAlign: 'left' }}>
                    <a href='https://www.aa.org/'>https://www.aa.org/</a>
                </ul>
            </div>
            <Footer />
        </>
    );
}
